import React from "react";
import data from "./data";
import "./Project.scss";

function Project() {
  return (
    <div className="project">
      <div className="project-title"> Current Projects</div>
      <div className="project-card">
        {data.map((item) => {
          return item.title;
        })}
      </div>
    </div>
  );
}

export default Project;
